import React from "react";
import HeroImg from "../assets/backgroundimg.png";

function HeroSection() {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        boxShadow: "inset 0 0 0 1000px rgba(0, 0, 0, 0.2)",
        objectFit: "contain",
      }}
    >
      <img src={HeroImg}></img>
    </div>
  );
}

export default HeroSection;
